import logo from './logo.svg';
import './App.css';

function App() {
  const element=(
    <a href="#" style="float:left;margin:0.75% 1%">
          <div>
            <img src="https://i.postimg.cc/ZK7nCwqp/124.png" style="width:30px;height:30px;" />
            <img src="https://i.postimg.cc/g2jDZtHW/125.png" class="img-top" />
          </div>
    </a>
  );
  return (element);
}

export default App;
